import React from 'react'
import { Box, Paper, DialogTitle, Dialog, DialogContent, Switch, TextField } from '@material-ui/core'
import { withStyles } from '@material-ui/core/styles'
import PropTypes from 'prop-types'
import Text from '../text'

const styles = (theme) => ({
    root : {
        width : "100vw",
        height : "100vh",
        backgroundColor : "rgba(0,0,0,0.3)",
        display : "flex",
        justifyContent : "center",
        alignItems : "center",
        position : "absolute",

    },
    map : {
        backgroundImage : 'url(/static/images/map.png)',
        backgroundRepeat : "no-repeat",
        backgroundSize : "cover",
        width : "100%",
        height : 300 
    },
    useCurrent : {
        display : "flex",
        alignItems : "center"
    }
})

const Location = ({ classes, handleClose, open }) => {
    return <Box className={classes.root}>
        <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
        fullWidth={true}
      >
        <DialogTitle id="alert-dialog-title"><Text variant="h6" ffamily="Poppins">Add new address.</Text></DialogTitle>
        <Box className={classes.map} />
        <DialogContent>
        <Box className={classes.useCurrent}>
            <Text variant="caption" style={{ marginRight : 10, marginBottom : 0}} ffamily="Poppins">Use Current Location</Text>
            <Switch
                // checked={state.checkedA}
                // onChange={handleChange}
                name="checkedA"
                inputProps={{ 'aria-label': 'secondary checkbox' }}
            />
        </Box>
        <Box>
            <TextField
                id="outlined-multiline-static"
                label="Additional Address"
                multiline
                rows={2}
                variant="outlined"
            />
        </Box>


        </DialogContent>
      </Dialog>
    </Box>
}

Location.propTypes = {
    open : PropTypes.bool,
    handleClose : PropTypes.func,
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Location)
